talWrite(LED_BUILTIN, LOW);    // Turn the LED off\n  delay(1000);                       // Wait for a second\n}"}}},controlStructures:{title:"Control Structures",icon:l,items:{if:{title:"if",description:"The if statement allows for conditional execution of code. If the condition in the parentheses is true, the code inside the curly braces is executed.",code:"int value = 10;\nif (value > 5) {\n  // this code will run\n}"},else:{title:"if...else",description:"An else statement can follow an if statement to provide code that is executed when the if condition is false.",code:"int value = 3;\nif (value > 5) {\n  // this code will not run\n} else {\n  // this code will run\n}"},for:{title:"for",description:"The for loop is used to repeat a block of code a specific number of times.",code:"for (int i = 0; i < 5; i++) {\n  Serial.println(i); // Prints 0, 1, 2, 3, 4\n}"},while:{title:"while",description:"A while loop will execute a block of code as long as a specified condition is true.",code:"int i = 0;\nwhile (i < 5) {\n  Serial.println(i);\n  i++;\n}"},"do-while":{title:"do...while",description:"Similar to a while loop, but the condition is checked at the end. This guarantees the loop will execute at least once.",code:"int i = 0;\ndo {\n  Serial.println(i);\n  i++;\n} while (i < 5);"},"switch-case":{title:"switch...case",description:"A switch statement allows a variable to be tested for equality against a list of values (cases).",code:'int sensorValue = analogRead(A0);\nswitch (sensorValue) {\n  case 0:\n    Serial.println("Value is 0");\n    break;\n  case 100:\n    Serial.println("Value is 100");\n    break;\n  default:\n    Serial.println("Value is something else");\n    break;\n}'},break:{title:"break",description:"The break keyword is used to exit from a for, while, do...while, or switch statement.",code:"for (int i = 0; i < 10; i++) {\n  if (i == 5) {\n    break; // Exits the loop when i is 5\n  }\n  Serial.println(i);\n}"},continue:{title:"continue",description:"The continue keyword skips the rest of the current iteration of a loop and proceeds to the next iteration.",code:"for (int i = 0; i < 10; i++) {\n  if (i == 5) {\n    continue; // Skips printing 5\n  }\n  Serial.println(i);\n}"},return:{title:"return",description:"The return keyword terminates a function and can return a value to the calling function.",code:"int add(int a, int b) {\n  return a + b; // Returns the sum of a and b\n}"},goto:{title:"goto",description:"Transfers program control to a labeled statement. Its use is generally discouraged in favor of structured control flow like loops and if statements.",code:'void loop() {\n  int sensorValue = analogRead(A0);\n  if (sensorValue > 500) {\n    goto error;\n  }\n  delay(100);\n  return;\n\nerror:\n  Serial.println("Sensor value too high!");\n}'}}},syntax:{title:"Further Syntax",icon:d,items:{semicolon:{title:"; (semicolon)",description:"Used to end a statement in Arduino (C++).",code:"int x = 13; // The semicolon ends the line."},"curly-braces":{title:"{} (curly braces)",description:"Defines a block of code for functions, loops, and conditional statements.",code:"void setup() {\n  // This is a code block\n}"},"single-comment":{title:"// (single line comment)",description:"Anything after the // on the same line is ignored by the compiler.",code:"// This is a comment."},"block-comment":{title:"/* */ (block comment)",description:"Anything between /* and */ is ignored by the compiler, which can span multiple lines.",code:"/* This is a\n   multi-line\n   comment. */"},"#define":{title:"#define",description:"A preprocessor directive used to create a macro or a constant. It replaces all occurrences of the defined name with the value before compilation.",code:"#define LED_PIN 13\n\nvoid setup() {\n  pinMode(LED_PIN, OUTPUT);\n}"},"#include":{title:"#include",description:"A preprocessor directive used to include external libraries in your sketch.",code:"#include <Servo.h> // Includes the Servo library"}}},arithmeticOperators:{title:"Arithmetic Operators",icon:c,items:{assignment:{title:"= (assignment)",description:"Stores the value to the right of the operator in the variable to the left.",code:"int sensorValue = analogRead(A0); // Assigns the reading to sensorValue"},addition:{title:"+ (addition)",description:"Adds two numbers.",code:"int result = 5 + 3; // result is 8"},subtraction:{title:"- (subtraction)",description:"Subtracts the second number from the first.",code:"int result = 5 - 3; // result is 2"},multiplication:{title:"* (multiplication)",description:"Multiplies two numbers.",code:"int result = 5 * 3; // result is 15"},division:{title:"/ (division)",description:"Divides the first number by the second. For integers, the remainder is discarded.",code:"int result = 5 / 3; // result is 1"},remainder:{title:"% (modulo)",description:"Calculates the remainder of the division of two integers.",code:"int result = 5 % 3; // result is 2"}}},comparisonOperators:{title:"Comparison Operators",icon:u.A,items:{"equal-to":{title:"== (equal to)",description:"Tests if two values are equal.",code:"if (x == 5) { /* ... */ }"},"not-equal-to":{title:"!= (not equal to)",description:"Tests if two values are not equal.",code:"if (x != 5) { /* ... */ }"},"less-than":{title:"< (less than)",description:"Tests if the left value is less than the right value.",code:"if (x < 5) { /* ... */ }"},"greater-than":{title:"> (greater than)",description:"Tests if the left value is greater than the right value.",code:"if (x > 5) { /* ... */ }"},"less-than-equal":{title:"<= (less than or equal to)",description:"Tests if the left value is less than or equal to the right value.",code:"if (x <= 5) { /* ... */ }"},"greater-than-equal":{title:">= (greater than or equal to)",description:"Tests if the left value is greater than or equal to the right value.",code:"if (x >= 5) { /* ... */ }"}}},booleanOperators:{title:"Boolean Operators",icon:p.A,items:{and:{title:"&& (logical AND)",description:"Returns true only if both conditions are true.",code:"if (x > 0 && y > 0) { /* ... */ }"},or:{title:"|| (logical OR)",description:"Returns true if at least one of the conditions is true.",code:"if (x > 0 || y > 0) { /* ... */ }"},not:{title:"! (logical NOT)",description:"Inverts a boolean value, turning true to false and false to true.",code:"bool isReady = false;\nif (!isReady) { // True if isReady is false\n  /* ... */\n}"}}},pointerOperators:{title:"Pointer Operators",icon:h,items:{reference:{title:"& (reference)",description:"Returns the memory address of a variable.",code:"int myVar = 10;\nint* myPointer = &myVar; // myPointer now holds the address of myVar"},dereference:{title:"* (dereference)",description:"Accesses the value stored at a memory address held by a pointer.",code:"int myVar = 10;\nint* myPointer = &myVar;\nint value = *myPointer; // value is now 10"}}},bitwiseOperators:{title:"Bitwise Operators",icon:f,items:{and:{title:"& (bitwise AND)",description:"Performs a bitwise AND operation on each pair of corresponding bits.",code:"int a = 5;  // Binary: 0101\nint b = 3;  // Binary: 0011\nint result = a & b; // result is 1 (Binary: 0001)"},or:{title:"| (bitwise OR)",description:"Performs a bitwise OR operation on each pair of corresponding bits.",code:"int a = 5;  // Binary: 0101\nint b = 3;  // Binary: 0011\nint result = a | b; // result is 7 (Binary: 0111)"},xor:{title:"^ (bitwise XOR)",description:"Performs a bitwise exclusive OR (XOR) operation. The result is 1 only if the two bits are different.",code:"int a = 5;  // Binary: 0101\nint b = 3;  // Binary: 0011\nint result = a ^ b; // result is 6 (Binary: 0110)"},not:{title:"~ (bitwise NOT)",description:"Inverts all the bits of its operand.",code:"int a = 5;       // Binary: 00000101\nint result = ~a; // result is -6 (Binary: 11111010 in two's complement)"},"left-shift":{title:"<< (bitshift left)",description:"Shifts the bits of the left operand to the left by the number of positions specified by the right operand. Zeros are shifted in from the right.",code:"int a = 5; // Binary: 0101\nint result = a << 1; // result is 10 (Binary: 1010)"},"right-shift":{title:">> (bitshift right)",description:"Shifts the bits of the left operand to the right. The nature of the bits shifted in depends on the type of the variable.",code:"int a = 5; // Binary: 0101\nint result = a >> 1; // result is 2 (Binary: 0010)"}}},compoundOperators:{title:"Compound Operators",icon:m,items:{increment:{title:"++ (increment)",description:"Increases the value of an integer variable by one.",code:"int x = 2;\nx++; // x is now 3"},decrement:{title:"-- (decrement)",description:"Decreases the value of an integer variable by one.",code:"int x = 2;\nx--; // x is now 1"},"compound-addition":{title:"+= (compound addition)",description:"Adds the right operand to the left operand and assigns the result to the left operand.",code:"int x = 2;\nx += 3; // equivalent to x = x + 3; x is now 5"},"compound-subtraction":{title:"-= (compound subtraction)",description:"Subtracts the right operand from the left operand and assigns the result to the left operand.",code:"int x = 5;\nx -= 3; // equivalent to x = x - 3; x is now 2"},"compound-multiplication":{title:"*= (compound multiplication)",description:"Multiplies the left operand by the right operand and assigns the result to the left operand.",code:"int x = 2;\nx *= 3; // equivalent to x = x * 3; x is now 6"},"compound-division":{title:"/= (compound division)",description:"Divides the left operand by the right operand and assigns the result to the left operand.",code:"int x = 6;\nx /= 3; // equivalent to x = x / 3; x is now 2"},"compound-remainder":{title:"%= (compound remainder)",description:"Calculates the modulo of the left operand with the right operand and assigns the result to the left operand.",code:"int x = 7;\nx %= 3; // equivalent to x = x % 3; x is now 1"},"compound-bitwise-and":{title:"&= (compound bitwise AND)",description:"Performs bitwise AND and assigns.",code:"int x = 5; //